import React, { useState } from "react";
import PostList from "../component/postList";
import PlanInfo from "../component/plan_info";
import '../css/Main.css';
import "../css/mylist.css";

const Main = () => {
    const [positions, setPositions] = useState([]);

    const handleLogout = () => {
        axios.post('http://localhost:8000/auth/logout', {}, { withCredentials: true })
            .then((response) => {
                alert("Logout successful");
                navigate('/');
            })
            .catch((error) => {
                console.error('Logout error:', error.response ? error.response.data : error.message);
            });
    };

    return (
        <React.Fragment>
            <PlanInfo setPositions={setPositions} />
            <div>
                <PostList positions={positions} />
            </div>
            <a className="my_plan" href={"/my_plan"}>마이 플랜</a>
            
        </React.Fragment>
    )
}

export default Main;
